import React from 'react';
import { MemberCard, EventCard, GoalCard } from './FooterCards.js';
import '../../css/footer.css';

const Footer = () => {
  return (
    <div>
      <MemberCard />
      <EventCard />
      <GoalCard />
    </div>
  )
}

export default Footer;
